                else:
                    atk_I = 0
            elif n[0] == 'k':
                if atk_N == 5:
                    return 'Nakajima-kun'
                elif atk_N == 0:
                    return 'Isono-kun'
                else:
                    atk_N = 1
        elif i_n.count('kougekida') == 2:
            if atk_I > atk_N:
                return 'Isono-kun'
            elif atk_I == atk_N:
                atk_I = 0
                atk_N = 0
            else:
                return 'Nakajima-kun'
        elif i_n.count('kougekida') == 1:
            if i[0] == 'k':
                if atk_I == 0:
                    return 'Nakajima-kun'
                else:
                    return 'Isono-kun'
            elif atk_N == 0:
                return 'Isono-kun'
            else:
                return 'Nakajima-kun'
        else:
            atk_I += 1 if atk_I != 5 else 0
            atk_N += 1 if atk_N != 5 else 0
    return 'Hikiwake-kun'
